import React from 'react';
import { useSelector } from 'react-redux';
import './ShippingOptions.css';

const ShippingOptions = () => {
  const cart = useSelector(state => state.cart);
  const { email, state, country } = cart.checkoutInfo;

  return(
    <div className='shipping-options'>
      <div className='shipping-info-box'>
        <div className='shipping-info-contact'>
          <div className='flex'>
            <div className='margin-right color-2'>Contact</div>
            <div>{email}</div>
          </div>
          <div className='font-small'>Change</div>
        </div>
      </div>
      <h3>Shipping method</h3>
      <div className='shipping-radio-box'>
        <div>
          <input type='radio' name='shippingOption'></input>
          <label htmlFor='shippingOption'>USPS Express Shipping</label>
        </div>
        <div>$5</div>
      </div>
    </div>
  )
}

export default ShippingOptions;
